import ChatBox from './components/ChatBox';
import './App.css';

function App() {
  return (
    <div className="app-container">
      <header className="app-header">
        <h1>GPT1 Poem Chat</h1>
        <p>Nhập vài từ, nhận thơ từ GPT-1!</p>
      </header>
      <main>
        <ChatBox />
      </main>
    </div>
  );
}

export default App;
